import { Link } from "react-router-dom";
import { motion } from "framer-motion";
import {
  RiShieldCheckLine,
  RiBankLine,
  RiUserLine,
} from "react-icons/ri";

export default function Landing() {
  return (
    <div className="min-h-screen flex flex-col bg-gradient-to-b from-white to-hdfc-gray text-gray-900">

      {/* Top Branding Strip */}
      <div className="h-2 bg-hdfc-blue"></div>

      {/* NAVBAR */}
      <header className="w-full py-4 px-8 bg-white shadow-md border-b border-gray-200 flex justify-between items-center">
        <h1 className="text-2xl font-extrabold tracking-wide hdfc-logo-box">
          HDFC DIGITAL KYC
        </h1>

        <nav className="space-x-6 text-sm font-semibold">
          <Link to="/" className="text-gray-700 hover:text-hdfc-blue">Home</Link>
          <Link to="/login" className="text-gray-700 hover:text-hdfc-blue">Login</Link>
          <Link to="/register" className="text-gray-700 hover:text-hdfc-blue">Register</Link>
        </nav>
      </header>

      {/* HERO SECTION */}
      <section className="flex-1 w-full max-w-6xl mx-auto flex flex-col items-center justify-center text-center px-6 py-20">
        <motion.h1
          initial={{ opacity: 0, y: -20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          className="text-5xl md:text-6xl font-extrabold text-hdfc-blue"
        >
          Complete Your KYC Securely & Paperlessly
        </motion.h1>

        <motion.p
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.25, duration: 0.6 }}
          className="text-lg text-gray-600 max-w-2xl mt-4 mb-10"
        >
          A fast, secure, and seamless onboarding experience powered by HDFC-grade encryption and compliance.
        </motion.p>

        {/* CTA BUTTONS */}
        <motion.div
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.35 }}
          className="flex space-x-5"
        >
          <Link className="btn-hdfc px-10 py-3 text-lg" to="/register">
            Get Started
          </Link>

          <Link className="btn-hdfc-outline px-10 py-3 text-lg" to="/login">
            Login
          </Link>
        </motion.div>
      </section>

      {/* FEATURE SECTION */}
      <section className="w-full py-16 bg-white shadow-inner rounded-t-3xl border-t border-gray-100">
        <h2 className="text-center text-3xl font-bold text-hdfc-blue mb-12">
          Why Choose HDFC Digital KYC?
        </h2>

        <div className="grid grid-cols-1 sm:grid-cols-3 gap-10 max-w-6xl mx-auto px-6">
          <FeatureCard
            icon={<RiShieldCheckLine size={48} className="text-hdfc-blue" />}
            title="Bank-Level Security"
            subtitle="Every document is encrypted and processed under strict security standards."
          />

          <FeatureCard
            icon={<RiBankLine size={48} className="text-hdfc-blue" />}
            title="Instant Verification"
            subtitle="Upload your document and get real-time status updates."
          />

          <FeatureCard
            icon={<RiUserLine size={48} className="text-hdfc-blue" />}
            title="Paperless & Hassle Free"
            subtitle="No queues. No branch visit. Complete KYC 100% online."
          />
        </div>
      </section>

      {/* FOOTER */}
      <footer className="hdfc-footer mt-auto text-sm">
        © {new Date().getFullYear()} HDFC Bank — Digital KYC System.
      </footer>
    </div>
  );
}

/* Feature Card Component */
function FeatureCard({ icon, title, subtitle }) {
  return (
    <motion.div
      whileHover={{ scale: 1.04 }}
      className="card-surface p-8 rounded-xl text-center transition cursor-pointer"
    >
      <div className="flex justify-center mb-4">{icon}</div>
      <h3 className="card-title mb-2">{title}</h3>
      <p className="text-gray-600 text-sm leading-relaxed">{subtitle}</p>
    </motion.div>
  );
}
